        }).then(Response => Response.json())
        .then(function(data){
            let strURL = "https://api.twitch.tv/helix/streams?user_login=" + data.data[0].to_name;
            return fetch(strURL, {
                method: 'GET',
                headers: {
                    'Client-ID': 'rc8uqc4k9iv82b8l339oymibbd3nkb'
                }
            })
        }).then(Response => console.log(Response.json()))
    }

